import React from 'react';
import { BrowserRouter as Router, Switch, Route , Link} from 'react-router-dom';
import classScreen from './_screens/classScreen';
import homeScreen from './_screens/homeScreen';


class App extends React.Component {
  render(){
    return (
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
              <li>
                <Link to="/Home">About</Link>
              </li>
            </ul>
          </nav>
          <Switch>
            <Route path="/" Component={classScreen}></Route>
            <Route path="/Home" Component={homeScreen}> </Route>
          </Switch>
        </div>
      </Router>
    );
  }
}
function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
export default App;
